def INIT(device) :                                                                                  #[INIT]
    device.DebugFuncEnter("INIT")
    device.SendTxtCmd("DSC_MODE=OFF,3V1")                                                           #DSC_MODE = OFF, 3V1
    device.SendTxtCmd("DSC_CFG=CLOCK,58000000")                                                     #DSC_CFG  = CLOCK, 58000000
    device.SendTxtCmd("BASE_CFG=DISPLAY_RATE,60,24")                                                #BASE_CFG = DISPLAY_RATE, 60, 24 ;171207_Only FPGA 통합, 26-->23-->24-->22
    device.SendTxtCmd("IFMODE0=MIPI")                                                               #IFMODE0  = MIPI
    FUN_EQUIPMENT(device)                                                                           #FUN/EQUIPMENT
    device.SendTxtCmd("MIPI_CONFIG=V_TIME,12,24,12,4,12,4")                                         #MIPI_CONFIG = V_TIME, 12, 24, 12, 4, 12, 4 ;170222_UPDATE
    device.SendTxtCmd("MIPI_CONFIG=CMD_TARGET,A")                                                   #MIPI_CONFIG = CMD_TARGET, A
    device.SendTxtCmd("MIPI_CONFIG=OUT_TARGET,A")                                                   #MIPI_CONFIG = OUT_TARGET, A
    device.SendTxtCmd("MIPI_CONFIG=INIT,60")                                                        #MIPI_CONFIG = INIT, 60
    device.SendTxtCmd("LCDSIZE0=1440,3168")                                                         #LCDSIZE0 = 1440, 3168
    device.PTRN_SET("OUT_DELAY,300")                                                                #PTRN_SET = OUT_DELAY, 300 ;170310_The IMG uploading delay time from Host to DDI (350->450)
    FUN_DSC_MODE_SEL(device)                                                                        #FUN/DSC_MODE_SEL
    FUN_DSC_HCONFIG(device)                                                                         #FUN/DSC_HCONFIG    ; 170222
    device.SendTxtCmd("IFMODE1=I2C")                                                                #IFMODE1  = I2C
    device.SendTxtCmd("I2C0_CFG=0x48,200000,1,ON,ON")                                               #I2C0_CFG = 0x48, 200000, 1, ON, ON ; 06/14 통신 속도 up
    device.SendTxtCmd("I2C_SET=I2C0_DELAY,0,100,10")                                                #I2C_SET  = I2C0_DELAY, 0, 100, 10 ; 171016 Delay 변경_I2C 통신 에러에 따른 데이터 오류 개선
    device.SendTxtCmd("AMPMES=MANUAL,1,20")                                                         #AMPMES  = MANUAL, 1, 20  ; 170204_Period set to check current
    device.SendTxtCmd("IOV=1.8,1.8")                                                                #IOV  = 1.8,   1.8  ; VBUS = 1.8V, VGP = 1.8V (AMS568AT01모델 VDD1 1.8V)
    device.SendTxtCmd("PVEXT_24V=ON")                                                               #PVEXT_24V = ON
    device.SendTxtCmd("PVEXT_5V=ON")                                                                #PVEXT_5V = ON
    FUN_TESTER_INIT(device)                                                                         #FUN/TESTER_INIT
    FUN_CYL_OFF(device)                                                                             #FUN/CYL_OFF
    FUN_VER_CHK(device)                                                                             #FUN/VER_CHK
    device.Message("SYSTEM INIT OK")                                                                #MESSAGE  = "SYSTEM INIT OK"
    device.DebugFuncLeave("INIT")

