def FUN_PASSWORD_UNLOCK(device) :                                                                   #[FUN/PASSWORD_UNLOCK]
    device.DebugFuncEnter("FUN_PASSWORD_UNLOCK")
    wregList=[0x5a, 0x5a]; device.WREG0_39(0x9F, 2, wregList)                                       #WREG0  = 0x39, 0x9F, 0x5A,0x5A ;PASSWORD0 unlock
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A,0x5A ;PASSWORD1 unlock
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF1, 2, wregList)                                       #WREG0  = 0x39, 0xF1, 0x5A,0x5A ;PASSWORD2 unlock
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A,0x5A ;PASSWORD3 unlock
    device.DebugFuncLeave("FUN_PASSWORD_UNLOCK")

