def FUN_MAN_16(device) :                                                                            #[FUN/MAN_16]
    device.DebugFuncEnter("FUN_MAN_16")
    device.Message("IMG_UPDATE...")                                                                 #MESSAGE  = "IMG_UPDATE..."
    device.WREG0_15(0x53, 0x20)                                                                     #WREG0  = 0x15, 0x53, 0x20 ; Brightness Control ON
    device.DelayMS(20)                                                                              #DELAYMS  = 20
    device.SendTxtCmd("DSI_HSLP=HS")                                                                #DSI_HSLP = HS
    FUN_PTRN_RGB_H(device)                                                                          #FUN/PTRN_RGB_H
    device.DebugFuncLeave("FUN_MAN_16")

def FUN_MAN_17(device) :                                                                            #[FUN/MAN_17]
    device.DebugFuncEnter("FUN_MAN_17")
    device.Message("DISP_ON...")                                                                    #MESSAGE  = "DISP_ON..." 
    device.WREG0_15(0xB0, 0x10)                                                                     #WREG0=0X15,0XB0,0X10
    device.WREG0_15(0xEF, 0xff)                                                                     #WREG0=0X15,0XEF,0XFF ;DISP_ON
    device.WREG0_05(0x29)                                                                           #WREG0=0X05,0X29  ;DISPLAY ON
    device.DelayMS(50)                                                                              #DELAYMS  = 50
    device.Message("ERROR CODE CHECK...")                                                           #MESSAGE  = "ERROR CODE CHECK..."
    device.Message("MIPI5...")                                                                      #MESSAGE  = "MIPI5..."
    device.SendTxtCmd("RREG0=0XE9,4")                                                               #RREG0=0XE9,4
    device.Message("RDDPM...")                                                                      #MESSAGE  = "RDDPM..."
    device.SendTxtCmd("RREG0=0X0A,1")                                                               #RREG0=0X0A,1
    device.Message("RDDSDR...")                                                                     #MESSAGE  = "RDDSDR..."
    device.SendTxtCmd("RREG0=0X0F,1")                                                               #RREG0=0X0F,1
    device.Message("OTPCHECK...")                                                                   #MESSAGE  = "OTPCHECK..."
    device.SendTxtCmd("RREG0=0XD1,4")                                                               #RREG0=0XD1,4
    device.DelayMS(10)                                                                              #DELAYMS  = 10
    device.Message("MANUAL END...")                                                                 #MESSAGE  = "MANUAL END..."
