def FUN_FLASH_GAMMA_MODE(device) :                                                                  #[FUN/FLASH_GAMMA_MODE]
    device.DebugFuncEnter("FUN_FLASH_GAMMA_MODE")
    device.Message("FLASH_GAMMA_MODE")                                                              #MESSAGE  = "FLASH_GAMMA_MODE"
    device.SendTxtCmd("SPI_CFG=ON,SW,4LINE")                                                        #SPI_CFG  = ON, SW, 4LINE
    FUN_FLASH_RELAY_ON(device)                                                                      #FUN/FLASH_RELAY_ON   ; default=L(FLASH_WRITE), H(FLASH_LOAD)
    device.DelayMS(150)                                                                             #DELAYMS  = 150   ; 180705 300 -> 150 @ relay on 150ms+
    device.SendTxtCmd("FLASH_CHECK_SUM=10")                                                         #FLASH_CHECK_SUM = 10   ; Flash Read & Checksum
    device.DelayMS(50)                                                                              #DELAYMS  = 50   ; Test
    device.SendTxtCmd("NDIM_TEST_FLASH=10")                                                         #NDIM_TEST_FLASH = 10   ; Write, if dll does not have a data read flash gamma and write
    wregList=[0x20]; device.WREG0_39(0x53, 1, wregList)                                             #WREG0  = 0x39, 0x53, 0x20
    device.SendTxtCmd("RREG0=0xC8,60")                                                              #RREG0  = 0xC8, 60  ; COORDV48 NG Monitoring
    device.SendTxtCmd("RREG0=0x0A,1")                                                               #RREG0  = 0x0A, 1
    device.SendTxtCmd("RREG0=0x0F,1")                                                               #RREG0  = 0x0F, 1
    device.DebugFuncLeave("FUN_FLASH_GAMMA_MODE")

