def FUN_IC_WRITE(device) :                                                                          #[FUN/IC_WRITE]
    device.DebugFuncEnter("FUN_IC_WRITE")
    device.Message("OTP WRITE NORMAL START")                                                        #MESSAGE  = "OTP WRITE NORMAL START"
    device.SendTxtCmd("DSI_HSLP=LP")                                                                #DSI_HSLP = LP
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A, 0x5A ; OTP Key ON
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF1, 2, wregList)                                       #WREG0  = 0x39, 0xF1, 0x5A, 0x5A ; OTP Key ON
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0x5A, 0x5A ; Level 3 Key ON
    wregList=[0x0b]; device.WREG0_39(0xB0, 1, wregList)                                             #WREG0  = 0x39, 0xB0, 0X0B
    wregList=[0x08]; device.WREG0_39(0xFB, 1, wregList)                                             #WREG0  = 0x39, 0xFB, 0x08 ; SLP_PG_OFF
    FUN_SLEEP_IN(device)                                                                            #FUN/SLEEP_IN
    device.DelayMS(120)                                                                             #DELAYMS  = 120
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    FUN_MTPV_ON(device)                                                                             #FUN/MTPV_ON    ; VPP 3단 전압 적용 2V ->4V ->5.8V
    device.DelayMS(25)                                                                              #DELAYMS  = 25
    FUN_OTP_REGISTER_SET(device)                                                                    #FUN/OTP_REGISTER_SET
    device.SendTxtCmd("GAMMA_WRITE")                                                                #GAMMA_WRITE
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    device.WREG0_15(0xD0, 0x01)                                                                     #WREG0  = 0x15, 0xD0, 0x01 ; WRFG = 1 : Start OTP Write Operation
    device.DelayMS(2000)                                                                            #DELAYMS  = 2000   ; 3FA3의 경우 중화향 감마모드2 사용으로
    wregList=[0xa5, 0xa5]; device.WREG0_39(0xF1, 2, wregList)                                       #WREG0  = 0x39, 0xF1, 0xA5, 0xA5 ; OTP Key OFF
    wregList=[0xa5, 0xa5]; device.WREG0_39(0xFC, 2, wregList)                                       #WREG0  = 0x39, 0xFC, 0xA5, 0xA5 ; Level 3 Key OFF
    FUN_MTPV_OFF(device)                                                                            #FUN/MTPV_OFF    ; VPP 전압 OFF
    device.DelayMS(250)                                                                             #DELAYMS  = 250   ; 170802 LSI confirm
    device.DelayMS(5)                                                                               #DELAYMS  = 5
    device.Message("OTP WRITE NORMAL END")                                                          #MESSAGE  = "OTP WRITE NORMAL END"
    FUN_RESET(device)                                                                               #FUN/RESET
    FUN_AUTO_INITIAL3(device)                                                                       #FUN/AUTO_INITIAL3   ; POC Loading Delay 100ms for SEC SET Condition_161205
    device.DebugFuncLeave("FUN_IC_WRITE")

