def FUN_POWER_OFF(device) :                                                                         #[FUN/POWER_OFF]
    device.DebugFuncEnter("FUN_POWER_OFF")
    device.SendTxtCmd("IOV=1.8,1.8")                                                                #IOV  = 1.8,   1.8
    device.SendTxtCmd("VVBAT1=0.0")                                                                 #VVBAT1  = 0.0
    device.SendTxtCmd("VELVSS=0.0")                                                                 #VELVSS  = 0.0
    device.SendTxtCmd("VVDD2=0.0")                                                                  #VVDD2  = 0.0
    device.DelayMS(10)                                                                              #DELAYMS  = 10   ; VDDR delay DDI Guide
    device.SendTxtCmd("VVDD1=0.0")                                                                  #VVDD1  = 0.0
    device.SendTxtCmd("VVCI=0.0")                                                                   #VVCI  = 0.0
    device.SendTxtCmd("VVBAT2=0.0")                                                                 #VVBAT2  = 0.0
    device.SendTxtCmd("VVEXT1=0.0")                                                                 #VVEXT1  = 0.0
    device.SendTxtCmd("VVEXT2=0.0")                                                                 #VVEXT2  = 0.0
    device.SendTxtCmd("AVBAT1=4A,1999.0,0.0")                                                       #AVBAT1  = 4A,  1999.0,  0.0
    device.SendTxtCmd("AELVSS=4A,1999.0,0.0")                                                       #AELVSS  = 4A,  1999.0,  0.0
    device.SendTxtCmd("AVDD1=200mA,499.0,0.0")                                                      #AVDD1  = 200mA, 499.0,  0.0
    device.SendTxtCmd("AVCI=200mA,499.0,0.0")                                                       #AVCI  = 200mA, 499.0,  0.0
    device.SendTxtCmd("AVBAT2=200mA,499.0,0.0")                                                     #AVBAT2  = 200mA, 499.0,  0.0
    device.SendTxtCmd("AVDD2=200mA,499.0,0.0")                                                      #AVDD2  = 200mA, 499.0,  0.0
    device.DelayMS(350)                                                                             #DELAYMS  = 350
    device.SendTxtCmd("PVBAT1=OFF")                                                                 #PVBAT1  = OFF
    device.SendTxtCmd("PELVSS=OFF")                                                                 #PELVSS  = OFF
    device.SendTxtCmd("PVDD1=OFF")                                                                  #PVDD1  = OFF
    device.SendTxtCmd("PVCI=OFF")                                                                   #PVCI  = OFF
    device.SendTxtCmd("PVBAT2=OFF")                                                                 #PVBAT2  = OFF
    device.SendTxtCmd("PVDD2=OFF")                                                                  #PVDD2  = OFF
    device.SendTxtCmd("PVEXT1=OFF")                                                                 #PVEXT1  = OFF
    device.SendTxtCmd("PVEXT2=OFF")                                                                 #PVEXT2  = OFF
    device.Message("POWER OFF")                                                                     #MESSAGE  = "POWER OFF"
    device.DebugFuncLeave("FUN_POWER_OFF")

def FUN_POWER_ON(device) :                                                                          #[FUN/POWER_ON]
    device.DebugFuncEnter("FUN_POWER_ON")
    device.SendTxtCmd("IOV=1.8,1.8")                                                                #IOV  = 1.8, 1.8
    device.SendTxtCmd("VVCI=3.0")                                                                   #VVCI  = 3.0
    device.SendTxtCmd("VVBAT2=3.0")                                                                 #VVBAT2  = 3.0
    device.SendTxtCmd("VVDD2=1.8")                                                                  #VVDD2  = 1.8
    device.SendTxtCmd("PVBAT1=ON")                                                                  #PVBAT1  = ON
    device.SendTxtCmd("PVDD1=ON")                                                                   #PVDD1  = ON   ; VDDI Soft start
    device.DelayMS(50)                                                                              #DELAYMS  = 50   ; Relay Chattering 안정화 Delay
    device.SendTxtCmd("AVBAT1=4A,1999.0,0.0")                                                       #AVBAT1  = 4A,  1999.0, 0.0 ; 170202 update_only T5 apply
    device.SendTxtCmd("AVDD1=500mA,500,0.0")                                                        #AVDD1  = 500mA, 500, 0.0
    device.SendTxtCmd("AVCI=200mA,100,0.0")                                                         #AVCI  = 200mA, 100, 0.0
    device.SendTxtCmd("AVBAT2=200mA,80,0.0")                                                        #AVBAT2  = 200mA, 80, 0.0
    device.SendTxtCmd("AVDD2=200mA,300,0.0")                                                        #AVDD2  = 200mA,300, 0.0
    device.SendTxtCmd("VVBAT1=4.0")                                                                 #VVBAT1  = 4.0   ; VBAT inrush Improve Seq
    device.SendTxtCmd("VVDD1=1.8")                                                                  #VVDD1  = 1.8
    device.DelayMS(100)                                                                             #DELAYMS  = 100   ; T2/T5 Power delay and VBAT Stabilize delay
    device.SendTxtCmd("PVCI=ON")                                                                    #PVCI  = ON
    device.DelayMS(10)                                                                              #DELAYMS  = 10   ; VDDR delay DDI Guide
    device.SendTxtCmd("PVDD2=ON")                                                                   #PVDD2  = ON
    device.SendTxtCmd("PVBAT2=ON")                                                                  #PVBAT2  = ON
    device.DelayMS(50)                                                                              #DELAYMS  = 50   ; 안정화 delay
    device.Message("POWER ON")                                                                      #MESSAGE  = "POWER ON"
    device.DebugFuncLeave("FUN_POWER_ON")

