def FUN_SLEEP_OUT(device) :                                                                         #[FUN/SLEEP_OUT]
    device.DebugFuncEnter("FUN_SLEEP_OUT")
    device.DelayMS(20)                                                                              #DELAYMS  = 20
    device.WREG0_05(0x11)                                                                           #WREG0  = 0x05, 0x11  ; Sleep out
