    device.WREG0_15(0xF8, 0x0f)                                                                     #WREG0  = 0x15, 0xF8, 0x0F
    device.WREG0_15(0xB0, 0x13)                                                                     #WREG0  = 0X15, 0XB0, 0X13
    device.WREG0_15(0xF8, 0x28)                                                                     #WREG0  = 0X15, 0XF8, 0X28
    device.WREG0_15(0xB0, 0x23)                                                                     #WREG0  = 0X15, 0XB0, 0X23
    device.WREG0_15(0xF4, 0x74)                                                                     #WREG0  = 0X15, 0XF4, 0X74
