def FUN_SPI_IDLE_STATE_SET(device) :                                                                #[FUN/SPI_IDLE_STATE_SET]
    device.DebugFuncEnter("FUN_SPI_IDLE_STATE_SET")
    device.Message("SPI_IDLE_STATE_SET")                                                            #MESSAGE  = "SPI_IDLE_STATE_SET"
    wregList=[0x5a, 0x5a]; device.WREG0_39(0xF0, 2, wregList)                                       #WREG0  = 0x39, 0xF0, 0x5A, 0x5A
    wregList=[0x55, 0x0f]; device.WREG0_39(0x6F, 2, wregList)                                       #WREG0  = 0x39, 0x6F, 0x55, 0x0F
    device.DebugFuncLeave("FUN_SPI_IDLE_STATE_SET")

def FUN_TESTER_INIT(device) :                                                                       #[FUN/TESTER_INIT]
    device.DebugFuncEnter("FUN_TESTER_INIT")
    device.Message("TESTER_INIT")                                                                   #MESSAGE  = "TESTER_INIT"
    device.SendTxtCmd("AMPCHK=OFF")                                                                 #AMPCHK  = OFF
    device.SendTxtCmd("EXT_CFG=EXT1,OUT")                                                           #EXT_CFG  = EXT1, OUT  ; EXT1 OUTDIR___RESET
    device.SendTxtCmd("EXT_CFG=EXT2,IN")                                                            #EXT_CFG  = EXT2, IN  ; EXT2 OUTDIR___TE
    device.SendTxtCmd("EXT_CFG=EXT3,IN")                                                            #EXT_CFG  = EXT3, IN  ; EXT3 OUTDIR___ERR_FG
    device.SendTxtCmd("EXT_CFG=EXT4,IN")                                                            #EXT_CFG  = EXT4, IN  ; EXT4 OUTDIR___TSP_INT
    device.SendTxtCmd("EXT_CFG=EXT5,OUT")                                                           #EXT_CFG  = EXT5, OUT  ; EXT5 OUTDIR___TSP_TA
    device.SendTxtCmd("EXT_CFG=EXT6,IN")                                                            #EXT_CFG  = EXT6, IN  ; EXT6 OUTDIR___TSP_MOTO_AOD
    device.SendTxtCmd("EXT_CFG=EXT7,OUT")                                                           #EXT_CFG  = EXT7, OUT  ; EXT7 OUTDIR___CU GND I2C SDA
    device.SendTxtCmd("EXT_CFG=EXT8,OUT")                                                           #EXT_CFG  = EXT8, OUT  ; EXT8 COPR SPI H : OFF, L : ON
    device.SendTxtCmd("EXT_CFG=EXT9,OUT")                                                           #EXT_CFG  = EXT9, OUT  ; EXT9 POC SPI H : OFF, L : ON
    device.SendTxtCmd("EXT_CFG=EXTA,OUT")                                                           #EXT_CFG  = EXTA, OUT  ; EXT10 OUTDIR__ELVSS_Linear Driving
    device.SendTxtCmd("EXT_CFG=EXTB,IN")                                                            #EXT_CFG  = EXTB, IN  ; EXT10 OUTDIR__ELVSS_Linear Driving
    device.SendTxtCmd("EXT=0x00")                                                                   #EXT  = 0x00   ; ALL LOW
    device.SendTxtCmd("EXT8=H")                                                                     #EXT8  = H   ; COPR OFF
    device.SendTxtCmd("EXT9=H")                                                                     #EXT9  = H   ; POC OFF
    device.SendTxtCmd("RGB_DISPLAY=OFF")                                                            #RGB_DISPLAY = OFF
    device.SendTxtCmd("DSI_ENHSCLK=OFF")                                                            #DSI_ENHSCLK = OFF
    device.SendTxtCmd("GPEN=OFF")                                                                   #GPEN  = OFF
    device.SendTxtCmd("DSI_STOP")                                                                   #DSI_STOP
    FUN_POWER_OFF(device)                                                                           #FUN/POWER_OFF
    device.DebugFuncLeave("FUN_TESTER_INIT")

def FUN_TE_CHECK(device) :                                                                          #[FUN/TE_CHECK]
    device.DebugFuncEnter("FUN_TE_CHECK")
    wregList=[0x00]; device.WREG0_39(0x35, 1, wregList)                                             #WREG0  = 0x39, 0x35, 0x00 ; 0224 추가
    device.DelayMS(100)                                                                             #DELAYMS  = 100   ; 0224 추가
    device.SendTxtCmd("FREQ_CHECKFUN=EXT2,10,0,100.0,80.0,10.0,0,TE_CHECK_NG,TE_CHECK_OK")          #FREQ_CHECKFUN = EXT2, 10, 0, 100.0, 80.0, 10.0, 0,TE_CHECK_NG,TE_CHECK_OK ;1:EXT1~8, 2:Check Cycle, 3:SaveIndex,4:FreqMaxSpec, 5:Min, 6:DutySpecMax, 7:Min, 8:NGFUN,     9:OKFUN
    device.DelayMS(500)                                                                             #DELAYMS  = 500
    device.DebugFuncLeave("FUN_TE_CHECK")

def FUN_TE_CHECK_NG(device) :                                                                       #[FUN/TE_CHECK_NG]
    device.DebugFuncEnter("FUN_TE_CHECK_NG")
    device.Message("TE_CHECK_NG!!!")                                                                #MESSAGE  = "TE_CHECK_NG!!!"
    device.SendTxtCmd("RCV_CMD=MIT_MSG,TE_CHECK,NG")                                                #RCV_CMD  = MIT_MSG,TE_CHECK,NG
    FUN_PTRN_TE_NG(device)                                                                          #FUN/PTRN_TE_NG
    device.SendTxtCmd("BEEP=ON")                                                                    #BEEP  = ON
    device.SendTxtCmd("POPUP=ON,\"TE CHECK NG\"")                                                   #POPUP  = ON, "TE CHECK NG"
    device.DelayMS(1000)                                                                            #DELAYMS  = 1000
    device.SendTxtCmd("RCV_CMD=MIT_MSG,ZONE_FIN")                                                   #RCV_CMD  = MIT_MSG,ZONE_FIN
    device.SendTxtCmd("NEXTLOCK=ON")                                                                #NEXTLOCK = ON
    device.DebugFuncLeave("FUN_TE_CHECK_NG")

def FUN_TE_CHECK_OK(device) :                                                                       #[FUN/TE_CHECK_OK]
    device.DebugFuncEnter("FUN_TE_CHECK_OK")
    device.Message("TE_CHECK_GOOD!!!")                                                              #MESSAGE  = "TE_CHECK_GOOD!!!"
    device.SendTxtCmd("RCV_CMD=MIT_MSG,TE_CHECK,GOOD")                                              #RCV_CMD  = MIT_MSG,TE_CHECK,GOOD
    device.DebugFuncLeave("FUN_TE_CHECK_OK")

def FUN_TSP_CURRENT_CHECK(device) :                                                                 #[FUN/TSP_CURRENT_CHECK]
    device.DebugFuncEnter("FUN_TSP_CURRENT_CHECK")
    FUN_RESET(device)                                                                               #FUN/RESET
    FUN_AUTO_INITIAL2(device)                                                                       #FUN/AUTO_INITIAL2
    device.DelayMS(300)                                                                             #DELAYMS  = 300
    FUN_PTRN_V255(device)                                                                           #FUN/PTRN_V255
    device.DelayMS(300)                                                                             #DELAYMS  = 300
    FUN_TSP_CURRENT_LIMIT(device)                                                                   #FUN/TSP_CURRENT_LIMIT
    device.DelayMS(300)                                                                             #DELAYMS  = 300
    device.SendTxtCmd("RCV_CMD=MIT_MSG,TSP_CURRENT_CHECK,GET_CURCHK,6,IBAT,GET_IBAT,IVSS,GET_ISS,IDD,GET_IDD,ICI,GET_ICI,IBAT2,GET_IBAT2,IDD2,GET_IDD2")          #RCV_CMD  = MIT_MSG,TSP_CURRENT_CHECK,GET_CURCHK,6,IBAT,GET_IBAT,IVSS,GET_ISS,IDD,GET_IDD,ICI,GET_ICI,IBAT2,GET_IBAT2,IDD2,GET_IDD2
    FUN_NORMAL_CURRENT_LIMIT(device)                                                                #FUN/NORMAL_CURRENT_LIMIT
    device.DelayMS(500)                                                                             #DELAYMS  = 500
    device.DebugFuncLeave("FUN_TSP_CURRENT_CHECK")

def FUN_TSP_CURRENT_LIMIT(device) :                                                                 #[FUN/TSP_CURRENT_LIMIT]
    device.DebugFuncEnter("FUN_TSP_CURRENT_LIMIT")
    device.Message("TSP_CURRENT_LIMIT")                                                             #MESSAGE  = "TSP_CURRENT_LIMIT"
    device.SendTxtCmd("AVBAT2=200mA,50,0,0.0")                                                      #AVBAT2  = 200mA, 50, 0, 0.0
    device.DebugFuncLeave("FUN_TSP_CURRENT_LIMIT")

def FUN_TSP_RESET(device) :                                                                         #[FUN/TSP_RESET]
    device.DebugFuncEnter("FUN_TSP_RESET")
    device.Message("TSP HW RESET")                                                                  #MESSAGE  = "TSP HW RESET"
    device.SendTxtCmd("EXT_CFG=EXT5,OUT")                                                           #EXT_CFG  = EXT5, OUT
    device.SendTxtCmd("EXT5=H")                                                                     #EXT5  = H
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    device.SendTxtCmd("EXT5=L")                                                                     #EXT5  = L
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    device.SendTxtCmd("EXT5=H")                                                                     #EXT5  = H
    device.DelayMS(100)                                                                             #DELAYMS  = 100
    device.DebugFuncLeave("FUN_TSP_RESET")

def FUN_VER_CHK(device) :                                                                           #[FUN/VER_CHK]
    device.DebugFuncEnter("FUN_VER_CHK")
    device.Message("VER CHK START")                                                                 #MESSAGE  = "VER CHK START"
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"T4P\",\"7.17.8.10\"")                                     #BASE_CFG = VER_CHK, "T4P", "7.17.8.10"
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"T4PC\",\"5.17.7.1\"")                                     #BASE_CFG = VER_CHK, "T4PC", "5.17.7.1"
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"T4\",\"6.16.6.7\"")                                       #BASE_CFG = VER_CHK, "T4", "6.16.6.7"
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"T4C\",\"5.16.3.4\"")                                      #BASE_CFG = VER_CHK, "T4C", "5.16.3.4"
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"T5C\",\"6.18.11.2\"")                                     #BASE_CFG = VER_CHK, "T5C", "6.18.11.2" ; T5 깨짐 FPGA 업데이트
    device.SendTxtCmd("BASE_CFG=VER_CHK,\"FPGA\",\"181201\"")                                       #BASE_CFG = VER_CHK, "FPGA", "181201" ; T5 깨짐 FPGA 업데이트 -> Garbage 개선 검토
    device.Message("VERSION CHECK END")                                                             #MESSAGE  = "VERSION CHECK END"
    device.DebugFuncLeave("FUN_VER_CHK")

